detail.title:
Although valid, it is recommended to format conditional restrictions with:
- spaces around the `@`;
- uppercase `AND` (in combined restrictions);
- parentheses around all-but-the-simplest conditions.
This helps to prevent errors and improves readability.
For example, use `no @ (weight > 5 AND wet)` rather than `no@weight>5 and wet`.

Aunque es válido, se recomienda dar formato a las restricciones condicionales con:
- espacios alrededor de la `@`;
- mayúsculas `AND` (en restricciones combinadas);
- paréntesis alrededor de todas las condiciones excepto las más simples.
Esto ayuda a evitar errores y mejora la legibilidad.
Por ejemplo, utilice `no @ (weight > 5 AND wet)` en lugar de `no@weight>5 y wet`.

Незважаючи на дійсність, рекомендується форматувати умовні обмеження за допомогою:
- пробілів навколо `@`;
- `І` у верхньому регістрі (у комбінованих обмеженнях);
- круглі дужки навколо всіх умов, крім найпростіших.
Це допомагає запобігти помилкам і покращує читабельність.
Наприклад, використовуйте `no @ (weight > 5 AND wet)`, але не `no@weight>5 and wet`.
